import React from "react";
import axios from "axios";

const url="http://localhost:5140";


async function PostUsers(name, email, pass)
{
  const respons = await fetch(url,
  {
    method: "POST",
    headers:     
    {
      'Accept': 'application/json',
      'Content-Type': 'application/json'
    },
    body: JSON.stringify({
      name: name,
      email: email,
      password: pass
    })
  });
  if(respons.ok)
    console.log(11111);
}


function F()
{
    const[name, setName]=React.useState("");
    const[email, setEmail]=React.useState("");
    const[pass, setPass]=React.useState("");

    const handleSubmit = (e) => {
      e.preventDefault();
      PostUsers(name, email, pass)
    }
    return (
      <div className="F">
        <form onSubmit={handleSubmit}>
          <p>
            <label>Имя </label>
            <input type="text" value={name} onChange={(e) => setName(e.target.value)}></input>
          </p>
          <p>
            <label>Почта </label>
            <input type="text" value={email} onChange={(e) => setEmail(e.target.value)}></input>
          </p>
          <p>
            <label>Пароль </label>
            <input type="password" value={pass} onChange={(e) => setPass(e.target.value)}></input>
          </p>
          <input type="button" value="Зарегистрироваться"/>
        </form>
      </div>
    );
  }
    
    export default F;
